import React, { useEffect, useState } from "react";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Container,
  Button,
} from "@mui/material";
import { useAuthContext } from '../../hooks/useAuthContext';

const OwnerHome = () => {
  const [data, setdata] = useState([]);
  const { user } = useAuthContext();
  const houseId = JSON.parse(localStorage.getItem("User"));
  useEffect(() => {
    fetch(`http://localhost:4000/getguesthome/${houseId.Email}`, {
      headers: {
        "Authorization": `Bearer ${user.token}`
      }
    }).then((res) => {
      return res.json();
    }).then(data => {
      setdata(data);
      console.log(data);
    })
  }, []);

  const backgroundStyle = {
    background: "linear-gradient(135deg, #FFD700, #FF5733, #6AFB92)",
    padding: "20px",
    minHeight: "100vh",
  };

  return (
    <div style={backgroundStyle}>
      <Container maxWidth="lg">
        <TableContainer component={Paper}>
          <Table
            style={{
              minWidth: 650,
            }}
          >
            <TableHead>
              <TableRow>
                <TableCell
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  Header 1
                </TableCell>
                <TableCell
                  
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  HouseImage
                </TableCell>
                <TableCell
                  
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  User Name
                </TableCell>
                <TableCell
                  
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  User Email
                </TableCell>
                <TableCell
                  
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  User PhoneNumber
                </TableCell>
                <TableCell
                  
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  From Date
                </TableCell>
                <TableCell
                  
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  To Date
                </TableCell>
                <TableCell style={{
                    fontWeight: "bold",
                  }}>Edit</TableCell>
                <TableCell style={{
                    fontWeight: "bold",
                  }}>Delete</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              <TableRow>
                {
                    data ? (
                        <div></div>
                    ) : (
                      <h1>Loading....</h1>
                    )
                }
              </TableRow>
             
              {/* Add more rows as needed */}
            </TableBody>
          </Table>
        </TableContainer>
      </Container>
    </div>
  );
};

export default OwnerHome;
